  false,\n\t\"url\": null,\n\t\"notes\": \"This data represents the general size and
  locations of current or historical snowy plover populations and their breeding or
  wintering areas along the Pacific coast of California. Population data came from
  Appendix B of the \"Western Snowy Plover (Charadrius alexandrinus nivosus), Pacific
  Coast Population, Draft Recovery Plan, (U.S. Fish and Wildlife Service, Portland,
  Oregon. xix + 630 pp. incl. appendices). Potential areas occupied by plovers \"units\")
  were digitized from Appendix L of the Draft Recovery Plan. TIME PERIOD COVERED.
  Observations of population size were made from 1977 through 1998. No site appears
  to have been checked in every year, the number of visits and the years in which
  surveys were made varies from one area to another. GEOGRAPHIC EXTENT OF THE RECORDS.
  Snowy plover sites were delineated from the mouth of the Smith River in Del Norte
  County south along the coast to the Mexican border. NUMBER OF RECORDS. 169 records,
  each representing a polygon, define the location and breeding and wintering populations
  at 133 sites. BASE DATA STRUCTURE. Data comes from Appendices B and L of the Draft
  Recovery Plan. WHAT EACH RECORD REPRESENTS. Each record identifies a polygon that
  represents an area containing suitable habitat for snowy plovers and provides estimates
  of breeding and wintering populations of plovers. DATA SET CREDIT. The data set
  was assembled by the California Department of Fish and Game; the data was digitized
  by the Office of Spill Prevention and Response and the breeding and wintering population
  data were added by the Wildlife and Habitat Data Analysis Branch.\",\n\t\"license_title\":
